import "./Top5.css";

const Top5 = ({ prop }) => {
  return (
    <div className="top8">
      <b className="b236">{prop}</b>
      <button className="menu7">
        <div className="div295">주차</div>
        <div className="bxsdown-arrow8">
          <img className="pattern-matcher-icon1" alt="" src="/vector-53.svg" />
        </div>
      </button>
    </div>
  );
};

export default Top5;
